[Image Description: A poem that reads,
I found my lover buried six feet deep
Silently beckoning me towards her stillness
In the woods beneath my feet.
Her voice was carried to the ends of the earth
Like a siren that preyed
Not from the ocean, but from the dirt.
I found my lover in her fragile crate
With amber pools for eyes
And moss growing in her veins.
Her lips like honey were no longer sweet
And all I could taste was the cold sense of defeat.
This time I buried my lover ten feet deep
And with the sound of misery emanating from the forest of green,
I returned her to the earth.
Rooting her in sin,
So that my sorrow can lead me back
When she is halfway blooming
In this damp, dark prison.]

